{
  #logo-container .logo,
	.footer-logo-icon,
	#logo-icon,
	#logo-icon-container
  {
    content: url('https://cdn.discordapp.com/attachments/939621809404379136/1097687553882198136/TAMATUBE_LIGHT.png') !important;
    width: 116px !important;
    height: 32px !important;
    background-image: none !important;
  }

  html[dark] #logo-icon,
	html[dark] #logo-icon-container
  {
    content: url('https://cdn.discordapp.com/attachments/939621809404379136/1097687553605378119/TAMATUBE_DARK.png') !important;
    width: 116px !important;
    height: 32px !important;
    background-image: none !important;
  }
}
